import { RouterProvider } from 'react-router-dom';
import './App.css';
import routes from './routes/routes';

function App() {
  return (
    <div className="App">
      <div class="header">
        <h1>User Pages</h1>
      </div>
      <RouterProvider router={routes}/>
    </div>
  );
}

export default App;
